import React, { useEffect, useState } from "react";
import { Routes, Route, useNavigate } from "react-router-dom";
import Layout from "./Layout";
import { fetchDoctorProfile } from "../services/api";
import Profile from "./Profile";

const DoctorDashboard = () => {
  const [profileData, setProfileData] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    // Fetch the doctor profile when the component mounts
    const getProfile = async () => {
      try {
        const data = await fetchDoctorProfile(1); // Replace `1` with the actual profile ID
        setProfileData(data);
      } catch (error) {
        console.error("Error fetching doctor profile:", error);
      }
    };
    getProfile();
  }, []);

  const menuItems = [
    { name: "Profile", path: "profile" },
    // Add other options here in the future
    // { name: "Update", path: "update" },
    // { name: "Notifications", path: "notifications" },
    // { name: "Chat", path: "chat" },
    // { name: "Appointments", path: "appointments" },
    // { name: "Settings", path: "settings" },
  ];

  const handleMenuClick = (path) => {
    navigate(`/dashboard/doctor/${path}`);
  };

  return (
    <Layout menuItems={menuItems} onMenuClick={(item) => handleMenuClick(item.path)}>
      <Routes>
        <Route
          path="/profile"
          element={<Profile data={profileData} />}
        />
        <Route
          path="/"
          element={<h1>Welcome to the Doctor Dashboard</h1>}
        />
      </Routes>
    </Layout>
  );
};

export default DoctorDashboard;
